import React from "react";
import ReactDOM from "react-dom";

function card() {
  return (
    <>
      <div className="cards">
        <div className="card">
          <img
            src="https://assets.telegraphindia.com/telegraph/9ee8d472-70cb-485f-871a-8f886b8525f7.jpg"
            alt="myPic"
            className="card__img"
          />
          <div className="card__info">
            <span className="card__category"> A Netflix Original Series</span>
            <h3 className="card__title"> DARK </h3>
            <a href="https://www.netflix.com/gb/title/81232370" target="_blank">
              <button> Watch Now </button>
            </a>
          </div>
        </div>
      </div>
    </>
  );
}

ReactDOM.render(
  <card />,
  document.getElementById("root")
);
